import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';
import Layout from './components/Layout/Layout';
import ProtectedRoute from './components/ProtectedRoute';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import Dashboard from './components/Dashboard/Dashboard';
import SellerDashboard from './components/Seller/SellerDashboard';
import BuyerDashboard from './components/Buyer/BuyerDashboard';
import AppraiserDashboard from './components/Appraiser/AppraiserDashboard';
import AdminDashboard from './components/Admin/AdminDashboard';
import SupportDashboard from './components/Support/SupportDashboard';

const AppContent = () => {
  const { user, loading } = useAuth();

  if (loading) {
    return (
      <div className="loading">
        <div className="spinner"></div>
      </div>
    );
  }

  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      
      {/* Root redirect */}
      <Route path="/" element={<Navigate to="/login" replace />} />
      
      {/* Protected Routes */}
      <Route path="/dashboard" element={
        <ProtectedRoute>
          <Layout>
            <Dashboard />
          </Layout>
        </ProtectedRoute>
      } />
      
      <Route path="/protected/*" element={
        <ProtectedRoute>
          <Layout>
            <Routes>
              <Route path="/" element={<Navigate to="/dashboard" replace />} />
              
              {/* Seller Routes */}
              <Route path="/seller" element={
                <ProtectedRoute requiredRoles={['seller']}>
                  <SellerDashboard />
                </ProtectedRoute>
              } />
              <Route path="/seller/listings" element={
                <ProtectedRoute requiredRoles={['seller']}>
                  <SellerDashboard />
                </ProtectedRoute>
              } />
              <Route path="/seller/create" element={
                <ProtectedRoute requiredRoles={['seller']}>
                  <SellerDashboard />
                </ProtectedRoute>
              } />
              
              {/* Buyer Routes */}
              <Route path="/buyer" element={
                <ProtectedRoute requiredRoles={['buyer']}>
                  <BuyerDashboard />
                </ProtectedRoute>
              } />
              <Route path="/buyer/browse" element={
                <ProtectedRoute requiredRoles={['buyer']}>
                  <BuyerDashboard />
                </ProtectedRoute>
              } />
              <Route path="/buyer/orders" element={
                <ProtectedRoute requiredRoles={['buyer']}>
                  <BuyerDashboard />
                </ProtectedRoute>
              } />
              
              {/* Appraiser Routes */}
              <Route path="/appraiser" element={
                <ProtectedRoute requiredRoles={['appraiser']}>
                  <AppraiserDashboard />
                </ProtectedRoute>
              } />
              <Route path="/appraiser/evaluations" element={
                <ProtectedRoute requiredRoles={['appraiser']}>
                  <AppraiserDashboard />
                </ProtectedRoute>
              } />
              <Route path="/appraiser/reports" element={
                <ProtectedRoute requiredRoles={['appraiser']}>
                  <AppraiserDashboard />
                </ProtectedRoute>
              } />
              
              {/* Admin Routes */}
              <Route path="/admin" element={
                <ProtectedRoute requiredRoles={['admin']}>
                  <AdminDashboard />
                </ProtectedRoute>
              } />
              <Route path="/admin/users" element={
                <ProtectedRoute requiredRoles={['admin']}>
                  <AdminDashboard />
                </ProtectedRoute>
              } />
              <Route path="/admin/transactions" element={
                <ProtectedRoute requiredRoles={['admin']}>
                  <AdminDashboard />
                </ProtectedRoute>
              } />
              
              {/* Support Routes */}
              <Route path="/support" element={
                <ProtectedRoute requiredRoles={['support']}>
                  <SupportDashboard />
                </ProtectedRoute>
              } />
              <Route path="/support/feedback" element={
                <ProtectedRoute requiredRoles={['support']}>
                  <SupportDashboard />
                </ProtectedRoute>
              } />
              <Route path="/support/dashboard" element={
                <ProtectedRoute requiredRoles={['support']}>
                  <SupportDashboard />
                </ProtectedRoute>
              } />
              
              {/* Catch all route */}
              <Route path="*" element={<Navigate to="/dashboard" replace />} />
            </Routes>
          </Layout>
        </ProtectedRoute>
      } />
    </Routes>
  );
};

const App = () => {
  return (
    <AuthProvider>
      <AppContent />
    </AuthProvider>
  );
};

export default App;
